import React from 'react';

function NotFound() {
  return (
    <div className='h-screen'>
      <div className='flex items-center justify-center self-center content-center mt-64'>
        <h1 className='text-6xl mx-auto text-center '>404 Page not found</h1>
      </div>
    </div>
  );
}

export default NotFound;
